import axios from 'axios';
import booksData from '../tpl_json.json'
import useAsync from '../hooks/useAsync'

// 'https://raw.githubusercontent.com/TPLKoreanBook/TPLkoreanbooks/main/tpl_json.json'
async function getBooks() {
    const response = await axios.get('booksData');
    console.log(response);
    console.log(booksData);
    return response.data;
}

const BookList = () => {

    const [state, dispatch] = useAsync(getBooks, []);
    const { loading, data, error } = state;

    if (loading) return <div>Loading...</div>
    if (error) return <div>Error</div>
    if (!data) return null
    console.log(data.books[0]);
    return (
        <ul>
            {data.books[0].map((book, index) => (

                <li key={index}>
                    <h3>Title: {book.title}</h3>

                </li>

            ))}
        </ul>
    )
};

export default BookList;
